import React from 'react';

function Catigories({items, onClick}) {

  console.log(items)

  return (
    <div className="categories">
      <ul>
        <li className="active">Все</li>
        {items.map((item , i) => <li onClick={() => onClick(item)} key={`${item} + ${i}`} >{item}</li> )}
      </ul>
    </div>
  );
}

export default Catigories;
